import { useState } from "react";
import ExpensesFilter from "./ExpenseFilter";
import ExpenseForm from "./ExpenseForm";

const NewExpenses = (props)  => {
    const[filteredYear,setSelectedYear]=useState('2020');
    const OnSaveExpenseData = (enteredexpensedata) => {

        const enteredexpensedatavalue ={
            ...enteredexpensedata,
            id: Math.random().toString()
        };
        console.log(enteredexpensedatavalue);
        props.onAddExpenses(enteredexpensedatavalue);

    };
    
    function OnDatechangeHandler(selectedYear){
    console.log('sfromnewexpense');
    setSelectedYear(selectedYear);
  }
    return (
        <div className="new-expense">
        <ExpensesFilter defselectedYear={filteredYear} onFilterExpenseDate={OnDatechangeHandler}></ExpensesFilter>
        <ExpenseForm OnSaveExpenseDatahandler={OnSaveExpenseData}></ExpenseForm>
        </div>

    );

}
export default NewExpenses;
